var docData = {"document":{"title":"HostGen - Responsive Web Hosting with WHMCS Template"},"contents":[{"title":"Getting Started","contents":[{"title":"Welcome","content":"<p>Thank you for purchasing <b>HostGen</b> HTML template. If you have any question that are beyond the scope of this documentation, please feel free to contact us via our <a href=\"https://themeforest.net/user/themelooks#contact\" target=\"_blank\">ThemeForest profile contact form</a>. Thank you so much!</p><p><b>HostGen&nbsp;</b>is a&nbsp;<span style=\"background-color: rgb(250, 250, 250); color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 700;\">Responsive Web Hosting with WHMCS </span><b><span style=\"background-color: rgb(250, 250, 250); color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">T</span>emplate</b>. It's based on the latest stable <b>Bootstrap 4.1.3</b>. Anyone can easily update/edit this template by following our <b>Well Sorted Documentation</b>.</p><h4><b>Main Features:</b></h4><ul><li><b>Bootstrap 4</b> Framework</li><li>Fully <b>Responsive</b> Pages</li><li>Clean Design</li><li><b>Retina Ready</b></li><li>Possibilities to use 850+ <b>Google Fonts</b></li><li><b>Font Awesome</b> Icons</li><li><b>W3C Validated Code</b></li><li>Modern <b>Cross Browser Supported</b></li><li>In-depth <b>Documentation</b></li><li>Build With<b> SASS</b></li></ul>"},{"title":"Support","content":"<p style=\"font-family: &quot;Open Sans&quot;, sans-serif; color: rgb(0, 0, 0);\">Out support team works&nbsp;<span style=\"font-size: 14px; font-weight: bolder;\">from Saturday to Thursday</span><span style=\"font-size: 14px;\">. You can expect a response within one business day.</span></p><p><span style=\"font-weight: bolder; color: rgb(57, 123, 33);\">Support Requests Are For:</span></p><ul><li>Helping users to use the template</li><li>Instructions setting up template</li><li>Bug reports and fixes</li></ul><p><span style=\"color: rgb(255, 0, 0); font-weight: bold;\">Support Requests Arenâ€™t For:</span></p><ul><li>Helping with 3rd party plugins</li><li>Integration of 3rd party plugins</li><li>Free customization request of our template.</li></ul><p>Please take a look at our&nbsp;<a href=\"https://www.themelooks.com/support/support-policy/\" target=\"_blank\">Support Policy</a>.</p>"},{"title":"Installation","content":"<p>This is a simple static HTML template, so nothing fancy.</p><ul style=\"margin-bottom: 0px;\"><li>Open up your&nbsp;<span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: 700; font-family: Arial, verdana, arial, sans-serif; vertical-align: baseline; color: rgb(56, 56, 56); background-color: rgb(243, 243, 243);\">'FTP Software'</span><span style=\"color: rgb(56, 56, 56); font-family: Arial, verdana, arial, sans-serif; background-color: rgb(243, 243, 243);\">&nbsp;of choice and connect to your hosting.</span><br></li><li>Browse to required directory (Normally:&nbsp;<span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: 700; font-family: Arial, verdana, arial, sans-serif; vertical-align: baseline; color: rgb(56, 56, 56); background-color: rgb(243, 243, 243);\">./public_html</span><span style=\"color: rgb(56, 56, 56); font-family: Arial, verdana, arial, sans-serif; background-color: rgb(243, 243, 243);\">)</span></li><li><span style=\"color: rgb(56, 56, 56); font-family: Arial, verdana, arial, sans-serif; background-color: rgb(243, 243, 243);\">&nbsp;Unzip the&nbsp;<span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: 700; vertical-align: baseline;\">'main-files/html-template' or \"main-files/html-template-rt'</span>&nbsp;and choose which templates to upload.</span></li><li><span style=\"color: rgb(56, 56, 56); font-family: Arial, verdana, arial, sans-serif; background-color: rgb(243, 243, 243);\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: 700; vertical-align: baseline;\">Upload</span>&nbsp;the template to the server.</span></li></ul><p><b style=\"color: rgb(255, 0, 0);\"><br></b></p><p><img src=\"data:image/png;base64,\" data-filename=\"ftp.png\" style=\"width: 1213px;\"><b style=\"color: rgb(255, 0, 0);\"><br></b></p><p><b style=\"color: rgb(255, 0, 0);\">Note:</b> Check the <a href=\"#panel-10\">faq</a> section to get information about 'How to edit the content?'.</p>"},{"title":"Folder Structure","content":"<p><b>Template Files:</b></p><ul><li>/main-files/html-template/</li></ul><p><span style=\"font-weight: bolder;\">Template Files Boxed:</span></p><ul><li>/main-files/html-template-boxed/</li></ul><p><b>Documentation:</b></p><ul><li>/main-files/documentation/<br></li></ul>"},{"title":"Directory Structure Overview","content":"<p>/main-files/html-template/<br></p><p><img src=\"data:image/png;base64,\" data-filename=\"Screenshot_5.png\" style=\"width: 1213px;\"><br></p><p><br></p>"},{"title":"Browser  Support","content":"<p><b>HostGen</b> Supports a wide range of browsers.</p><table class=\"table table-bordered text-center\"><tbody><tr><td><p><img src=\"data:image/gif;base64,\" data-filename=\"temp.gif\" style=\"width: 31px; box-shadow: none;\"><b><br></b></p><p><b>Chrome</b></p></td><td><p><img src=\"data:image/gif;base64,\" data-filename=\"temp.gif\" style=\"width: 31px; box-shadow: none;\"><b><br></b></p><p><b>Firefox</b></p></td><td><p><img src=\"data:image/gif;base64,\" data-filename=\"temp.gif\" style=\"width: 28px; box-shadow: none;\"><b><br></b></p><p><b>Edge</b></p></td><td><p><img src=\"data:image/gif;base64,\" data-filename=\"temp.gif\" style=\"width: 28px; box-shadow: none;\"><b><br></b></p><p><b>Safari</b></p></td><td><p><img src=\"data:image/gif;base64,\" data-filename=\"temp.gif\" style=\"width: 30px; box-shadow: none;\"><b><br></b></p><p><b>Opera</b></p></td></tr><tr><td>Supported<br></td><td>Supported<br></td><td>Supported<br></td><td>Supported<br></td><td>Supported<br></td></tr></tbody></table>"},{"title":"FAQ","content":"<div id=\"faq_items\">\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem001\" aria-expanded=\"false\"><span style=\"background-color: transparent; font-family: inherit; font-weight: inherit;\">How to update an existing template?</span><br></button></h5>\n    </div>\n    <div id=\"faqItem001\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <ul><li>Make sure to <span style=\"color: rgb(255, 0, 0); font-weight: bold;\">backup all your previous files</span>.</li><li>Check 'Change log' to know the new changes.</li><li>The best way to update is to use a compare tool, like: <a href=\"https://www.devart.com/codecompare/\" target=\"_blank\">Code Compare</a>. And use it to compare the 'folders/files' (the version you're using with the new version).</li><li>***<span style=\"color: rgb(255, 0, 0); font-weight: bold;\">Updating HTML Templates Requires Manual Work</span>.</li><li>Replace 'custom.css' file or any other content from your backup.</li></ul>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem002\" aria-expanded=\"false\">\n          <span>How to change default color schemes?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem002\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <ul><li>Open <b>'.html'</b> file in a text editor.</li><li>Find the file <b>'theme-color-1.css'</b></li><li>Change the file name. (<span style=\"color: rgb(255, 0, 0);\">10 different color themes are provided in 'css/colors' folder</span>)</li><li>Available colors:</li><li><img src=\"data:image/png;base64,\" data-filename=\"color.png\" style=\"width: 142px;\"><br></li></ul>\n        <pre class=\"language-html\"><code>&lt;link rel=\"stylesheet\" href=\"css/colors/<u>theme-color-1.css</u>\"&gt;</code></pre>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem003\" aria-expanded=\"false\">\n          <span>How to remove preloader?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem003\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <ul><li>Open the file in a code editor. </li><li>Find the comment <b>'Preloader'</b>.</li><li>Remove code block.</li></ul>\n        <pre class=\"language-html\"><code>&lt;!-- Preloader --&gt;\n&lt;div class=\"preLoader\"&gt;&lt;/div&gt;</code></pre>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n   <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem004\" aria-expanded=\"false\">\n          <span>How to add image to support retina display?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem004\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Make 2 copies of your image. One default image (Example: file.png) and another retina supported image (Example: file@2x.png) in the same directory.</p><p><b>Note</b>: <code>data-rjs=\"2\"</code> attribute is added in img tag. Which is how retina images work. So if you add new image tag, make sure to add <code>data-rjs=\"2\"</code> to support retina display.</p>\n        <pre class=\"language-html\"><code>&lt;img src=\"img/logo.png\" <u>data-rjs=\"2\"</u> alt=\"Site Logo\"&gt;</code></pre>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem005\" aria-expanded=\"false\">\n          <span>How to change the logo?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem005\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p><img src=\"data:image/png;base64,\" data-filename=\"Screenshot_10.png\" style=\"width: 1208px;\">Open the file in a code editor. Find and change the code.</p>\n        <pre class=\"language-html\"><code>&lt;!-- Logo --&gt;\n&lt;div class=\"logo\"&gt;\n    &lt;a href=\"index.html\"&gt;\n        &lt;img src=\"<u>img/logo.png</u>\" data-rjs=\"2\" alt=\"Site logo\"&gt;\n    &lt;/a&gt;\n&lt;/div&gt;</code></pre>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n   <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem006\" aria-expanded=\"false\">\n          <span>How To Change Header Menu Links?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem006\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n       <p>Open <strong>'.html'</strong> file. (For Example: <strong>'index.html'</strong>)</p>\n\t\t<p>Find the comment <strong>'Start Header Menu'</strong></p>\n\n\t\t<p><img src=\"data:image/png;base64,\" data-filename=\"Screenshot_7.png\" style=\"width: 1168px;\"><img src=\"data:image/png;base64,\" data-filename=\"Screenshot_8.png\" style=\"width: 842px;\"></p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->  \n\n    <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem007\" aria-expanded=\"false\">\n          <span>How To Change Homepage Banner Content?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem007\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open <strong>'.html'</strong> file. (For Example: <strong>'index.html'</strong>)</p>\n        <p>Find the comment <b>'Start Hero Content'</b>.</p><p><img src=\"data:image/png;base64,\" data-filename=\"hero.png\" style=\"width: 877px;\"><img src=\"data:image/png;base64,\" data-filename=\"hero-2.png\" style=\"width: 734px;\"></p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem008\" aria-expanded=\"false\">\n          <span>How To Change YouTube Video Link?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem008\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open <strong>'.html'</strong> file. (For Example: <strong>'index.html'</strong>)</p>\n        <p>Find the Link <b>'https://www.youtube.com/watch?v=ctvlUvN6wSE'</b>.</p>\n        <p>Now Change it with yours.</p><p><img src=\"data:image/png;base64,\" data-filename=\"you.png\" style=\"width: 925px;\"></p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End --> \n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem009\" aria-expanded=\"false\">\n          <span>How To Change Background Image?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem009\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open <strong>'.html'</strong> file. (For Example: <strong>'index.html'</strong>)</p>\n        <p>Find&nbsp;<b>'data-bg-img=\"*'</b>.</p><p>Then choose yours.</p><p><img src=\"data:image/png;base64,\" data-filename=\"Screenshot_11.png\" style=\"width: 616px;\"></p><p><br></p><p><br></p><p><br></p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem010\" aria-expanded=\"false\">\n          <span>How To Change Pricing Item Contents?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem010\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open <strong>'.html'</strong> file. (For Example: <strong>'index.html'</strong>)</p>\n        <p>Find the comment <b>'Start Single Plan'</b>.</p><p><img src=\"data:image/png;base64,\" data-filename=\"plan.png\" style=\"width: 579px;\"></p><p><img src=\"data:image/png;base64,\" data-filename=\"plan 2.png\" style=\"width: 378px;\"><br></p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon\" data-toggle=\"collapse\" data-target=\"#faqItem011\" aria-expanded=\"true\">\n          <span>How To Change VPS HOSTING PLAN?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem011\" class=\"collapse show\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open <strong>'.html'</strong> file. (For Example: <strong>'index.html'</strong>)</p>\n        <p>Find the comment <b>'Start Single Plan Item '</b>.</p><p><img src=\"data:image/png;base64,\" data-filename=\"vps.png\" style=\"width: 740px;\"><br></p><p><img src=\"data:image/png;base64,\" data-filename=\"vps-2.png\" style=\"width: 1213px;\"><br></p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem012\" aria-expanded=\"false\">\n          <span>How To Change Testimonial Item Contents?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem012\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open <strong>'.html'</strong> file. (For Example: <strong>'index.html'</strong>)</p>\n        <p>Find the comment <strong>'Start Single Testimonial'</strong></p><p><strong><br></strong><img src=\"data:image/png;base64,\" data-filename=\"testi.png\" style=\"width: 778px;\"><img src=\"data:image/png;base64,\" data-filename=\"testi-2.png\" style=\"width: 849px;\"></p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n \n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem013\" aria-expanded=\"false\">\n          <span>How To Change Client Brand Image?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem013\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n       <p>Open <strong>'.html'</strong> file. (For Example: <strong>'index.html'</strong>)</p>\n        <p>Find the comment <strong>'Start Single Brand'&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></p><p><strong><br></strong><strong>&nbsp;</strong><img src=\"data:image/png;base64,\" data-filename=\"logo slider.png\" style=\"width: 666px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img src=\"data:image/png;base64,\" data-filename=\"Screenshot_9.png\" style=\"width: 1069px;\"></p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n    <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem014\" aria-expanded=\"false\">\n          <span>How To Change Blog Item Contents?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem014\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open <strong>'.html'</strong> file. (For Example: <strong>'index.html'</strong>)</p>\n        <p>Find the comment <b>'Start Single Blog'</b>.</p>\n        <p>Now Change it with yours.</p><p><img src=\"data:image/png;base64,\" data-filename=\"blog.png\" style=\"width: 867px;\"></p><p><img src=\"data:image/png;base64,\" data-filename=\"blog-2.png\" style=\"width: 374px;\"><br></p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem015\" aria-expanded=\"false\">\n          <span>How To Change Counter Item Content?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem015\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open <strong>'about.html'</strong> file.</p>\n        <p>Find the comment <strong>'Start Counter Area'</strong></p><p><strong><br></strong></p><p><img src=\"data:image/png;base64,\" data-filename=\"count.png\" style=\"width: 632px;\"></p><img src=\"data:image/png;base64,\" data-filename=\"count-2.png\" style=\"width: 1117px;\">\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem016\" aria-expanded=\"false\">\n          <span>How To Change Team Member Info?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem016\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open <strong>'about.html'</strong> file.</p>\n        <p>Find the comment <strong>'Start Single Team'</strong></p>\n        <img src=\"data:image/png;base64,\" data-filename=\"team.png\" style=\"width: 832px;\"><p></p><p><img src=\"data:image/png;base64,\" data-filename=\"team-2.png\" style=\"width: 1213px;\"></p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem017\" aria-expanded=\"false\">\n          <span>How To Change FAQ Item Contents?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem017\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open <strong>'.html'</strong> file. (For Example: <strong>'donmain.html'</strong>)</p>\n        <p>Find the comment <strong>'Start Single FAQ'</strong></p><p><strong><br></strong><img src=\"data:image/png;base64,\" data-filename=\"faq.png\" style=\"width: 862px;\"></p><p><img src=\"data:image/png;base64,\" data-filename=\"faq-2.png\" style=\"width: 678px;\"></p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End --> \n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem018\" aria-expanded=\"false\"><span style=\"background-color: transparent; font-family: inherit; font-weight: inherit;\">How to change the subscription form action link?</span></button></h5></div>\n <div id=\"faqItem018\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p><img src=\"data:image/png;base64,\" data-filename=\"subscribe.png\" style=\"width: 995px;\"></p><p>Open the file 'Index.html' in a code editor. Find Subscription area and change the action code.</p><p><img src=\"data:image/png;base64,\" data-filename=\"Screenshot_3.png\" style=\"width: 1036px;\"><br></p>\n       \n      </div>\n    </div>\n</div>\n  <!-- Card End -->\n\n   <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem018\" aria-expanded=\"false\">\n          <span>How To Change social icon links?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem016\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open <strong>'.html'</strong> file. (For Example: <strong>'index.html'</strong>)</p>\n        <p>Find the comment <b>'Start Social Icons'</b>.</p>\n        <p>Now Replace the it with yours</p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End --> \n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem019\" aria-expanded=\"false\">\n          <span>How To Change Copyright Text?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem019\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open <strong>'.html'</strong> file. (For Example: <strong>'index.html'</strong>)</p>\n        <p>Find the comment <b>'Start Copyright'</b>.</p><p>Now Replace it ..</p><p><img src=\"data:image/png;base64,\" data-filename=\"footer.png\" style=\"width: 708px;\"><br></p><p><img src=\"data:image/png;base64,\" data-filename=\"copy.png\" style=\"width: 413px;\"></p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem020\" aria-expanded=\"false\">\n          <span>How to change the contact form submission email and name?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem020\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open the file 'sendmail.php' in a code editor. Find and change the code.<br></p>\n        <pre class=\"language-php\"><code>// Settings\n$settings = array(\n\t\"name\"\t\t\t=&gt; \"<u>Admin</u>\",\n\t\"email\"\t\t\t=&gt; \"<u>example@domain.com</u>\",\n);</code></pre>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem021\" aria-expanded=\"false\">\n          <span>How to change animation?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem021\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open file in a text/code editor. Delete/update/add code.</p>\n        <pre class=\"language-html\"><code>&lt;div <u>data-animate=\"fadeInUp\"</u> <u>data-delay=\".5\"</u> <u>data-duration=\".5\"</u>&gt;</code></pre>\n        <p>Description:&nbsp;</p><ul><li>4 animation type is available for <code>data-animate</code><b></b>&nbsp;attribute. They are: <code>fadeInUp, fadeInDown, fadeInLeft, fadeInRight</code><b></b>.</li><li>Value for the <code>data-delay</code><b>&nbsp;</b>and<b>&nbsp;</b><code>data-duration</code>&nbsp;attributes can only be numeric and the <b>value is in second</b>.</li><li><code>data-delay</code><span style=\"font-weight: bolder;\">&nbsp;</span>and<span style=\"font-weight: bolder;\">&nbsp;</span><code>data-duration</code><span style=\"font-weight: bolder;\">&nbsp;</span>attributes are <b>optional</b>.<br></li></ul>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem022\" aria-expanded=\"false\">\n          <span>How to change the slider settings/options?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem022\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open the file <b>'.HTML'</b>.</p>\n        <pre class=\"language-js\"><code>data-owl-items=\"3\" data-owl-autoplay= \"true\" data-owl-speed= \"4000\" data-owl-margin=\"30\" data-owl-nav=\"true\" data-owl-responsive='{\"0\": {\"items\": \"1\"}, \"768\": {\"items\": \"3\"}}'</code>       \t\n\t\t</pre>\n        <p><b>Note</b>: Find the code for related slider. There are separate settings for every slider.</p><ul><li>'loop' Set to true to enable continuous loop mode</li><li>'slidesPerView' Number of slides per view (slides visible at the same time on slider's container)</li><li>'spaceBetween'&nbsp;Distance between slides in px</li><li>'speed'&nbsp;Duration of transition between slides (in ms)</li><li>'autoplay - delay' Duration to change every slide (in ms)</li><li>'disableOnInteraction'&nbsp;Set to false and autoplay will not be disabled after user interactions (swipes), it will be restarted every time after interaction</li></ul>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n\n  <!-- Card Start -->\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <h5 class=\"h5\">\n        <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem023\" aria-expanded=\"false\">\n          <span>How to update map location/options/Api?</span>\n        </button>\n      </h5>\n    </div>\n    <div id=\"faqItem023\" class=\"collapse\" data-parent=\"#faq_items\" style=\"\">\n      <div class=\"card-body\">\n        <p>Open <b>'contact.html' </b>in a code/text editor. Find the comment <b>'map'</b>.</p>\n       <p>Now Replace it what are you want<img src=\"data:image/png;base64,\" data-filename=\"map.png\" style=\"width: 959px;\"></p>\n      </div>\n    </div>\n  </div>\n  <!-- Card End -->\n</div>"},{"title":"Credits","content":"<h4><b>Photos:</b></h4><ul><li><i>All 'images' used on the demo site is for demonstration purposes only and are not included in the main download file.</i></li><li><i>All images collected from '<a href=\"https://images.google.com\" target=\"_blank\">Google Image Search</a>'</i></li></ul><h4><b>Fonts:</b></h4><ul><li><a href=\"https://fonts.google.com\" target=\"_blank\">Google Fonts</a> (<b>Muli</b>&nbsp;and <b>PT Sans</b>)</li></ul><h4><b>Frameworks / Libraries:</b></h4><p></p><ul><li><a href=\"http://jquery.com\" target=\"_blank\">jQuery</a></li><li><a href=\"http://getbootstrap.com\" target=\"_blank\">Twitter Bootstrap</a></li></ul><h4><b>Plugins:</b></h4><ul><li><a href=\"http://dimsemenov.com/plugins/magnific-popup/ target=\" _blank\"=\"\">Magnific Popup</a></li><li><a href=\"http://parsleyjs.org\" target=\"_blank\">Parsley</a></li><li><a href=\"https://github.com/strues/retinajs\" target=\"_blank\">Retinajs</a></li><li><a href=\"https://owlcarousel2.github.io/OwlCarousel2/\" target=\"_blank\">Owl Carousel</a></li><li><a href=\"http://imakewebthings.com/waypoints\" target=\"_blank\">Waypoints</a></li><li><a href=\"http://hilios.github.io/jQuery.countdown/\" target=\"_blank\">Countdown</a></li><li><a href=\"https://github.com/PHPMailer/PHPMailer\" target=\"_blank\">PHP Mailer</a><br><br></li></ul><p></p><p></p>\n\n"}]}]};
